INSERT INTO `pages` VALUES (3,'PolÃ­tica de Privacidade','<h2 style=\"box-sizing: border-box; font-family: \'Open Sans\'; font-weight: 500; line-height: 1.1; color: #333333; margin-top: 20px; margin-bottom: 10px; font-size: 30px; background-color: #ffffff;\"><strong>Pol&iacute;tica de privacidade da Fragr&acirc;ncia e Wine</strong></h2>\r\n<p>&nbsp;</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-size: 14px; font-family: \'Open Sans\'; background-color: #ffffff;\">Todas as suas informa&ccedil;&otilde;es pessoais recolhidas, ser&atilde;o usadas para o ajudar a tornar a sua visita no nosso site o mais produtiva e agrad&aacute;vel poss&iacute;vel.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-size: 14px; font-family: \'Open Sans\'; background-color: #ffffff;\">A garantia da confidencialidade dos dados pessoais dos utilizadores do nosso site &eacute; importante para o Fragr&acirc;ncia e Wine.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-size: 14px; font-family: \'Open Sans\'; background-color: #ffffff;\">Todas as informa&ccedil;&otilde;es pessoais relativas a membros, assinantes, clientes ou visitantes que usem o Fragr&acirc;ncia e Wine ser&atilde;o tratadas em concord&acirc;ncia com a Lei da Prote&ccedil;&atilde;o de Dados Pessoais de 26 de outubro de 1998 (Lei n.&ordm; 67/98).</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-size: 14px; font-family: \'Open Sans\'; background-color: #ffffff;\">A informa&ccedil;&atilde;o pessoal recolhida pode incluir o seu nome, e-mail, n&uacute;mero de telefone e/ou telem&oacute;vel, morada, data de nascimento e/ou outros.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-size: 14px; font-family: \'Open Sans\'; background-color: #ffffff;\">O uso do Fragr&acirc;ncia e Wine pressup&otilde;e a aceita&ccedil;&atilde;o deste Acordo de privacidade. A equipa do Fragr&acirc;ncia e Wine reserva-se ao direito de alterar este acordo sem aviso pr&eacute;vio. Deste modo, recomendamos que consulte a nossa pol&iacute;tica de privacidade com regularidade de forma a estar sempre atualizado.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-size: 14px; font-family: \'Open Sans\'; background-color: #ffffff;\">&nbsp;</p>\r\n<h3 style=\"box-sizing: border-box; font-family: \'Open Sans\', sans-serif; font-weight: 500; line-height: 1.1; color: #333333; margin-top: 20px; margin-bottom: 10px; font-size: 14pt; background-color: #ffffff;\">Os Cookies</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-size: 14px; font-family: \'Open Sans\'; background-color: #ffffff;\">Utilizamos cookies para armazenar informa&ccedil;&atilde;o, tais como as suas prefer&ecirc;ncias pessoas quando visita o nosso website. Isto poder&aacute; incluir um simples popup, ou uma liga&ccedil;&atilde;o em v&aacute;rios servi&ccedil;os que providenciamos.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-size: 14px; font-family: \'Open Sans\'; background-color: #ffffff;\">Voc&ecirc; det&eacute;m o poder de desligar os seus cookies, nas op&ccedil;&otilde;es do seu browser, ou efetuando altera&ccedil;&otilde;es nas ferramentas de programas Anti-Virus, como o Norton Internet Security. No entanto, isso poder&aacute; alterar a forma como interage com o nosso website, ou outros websites. Isso poder&aacute; afetar ou n&atilde;o permitir que fa&ccedil;a logins em programas, sites ou f&oacute;runs da nossa e de outras redes.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-size: 14px; font-family: \'Open Sans\'; background-color: #ffffff;\">&nbsp;</p>\r\n<h3 style=\"box-sizing: border-box; font-family: \'Open Sans\', sans-serif; font-weight: 500; line-height: 1.1; color: #333333; margin-top: 20px; margin-bottom: 10px; font-size: 14pt; background-color: #ffffff;\">Liga&ccedil;&otilde;es a Sites de terceiros</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-size: 14px; font-family: \'Open Sans\'; background-color: #ffffff;\">O Fragr&acirc;ncia e Wine possui liga&ccedil;&otilde;es com outros sites ex: (pagseguro), os quais, a nosso ver, podem conter informa&ccedil;&otilde;es / ferramentas &uacute;teis para os nossos visitantes. A nossa pol&iacute;tica de privacidade n&atilde;o &eacute; aplicada a sites de terceiros, pelo que, caso visite outro site a partir do nosso dever&aacute; ler a politica de privacidade do mesmo.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-size: 14px; font-family: \'Open Sans\'; background-color: #ffffff;\">N&atilde;o nos responsabilizamos pela pol&iacute;tica de privacidade ou conte&uacute;do presente nesses mesmos sites.</p>'),(4,'Termos de Uso','<div class=\"sc-bxivhb iwJxYV\" style=\"padding: 0px; margin: 0px -8px; box-sizing: border-box; display: flex; flex-flow: row wrap; align-items: flex-start; font-family: Montserrat, sans-serif; font-size: 16px;\">\r\n<div class=\"sc-ifAKCX dRLhAV\" style=\"padding: 0px 8px; margin: 0px; box-sizing: border-box; width: 1063.52px; max-width: 100%; align-self: auto;\">\r\n<h1 style=\"padding: 0px; margin: 0px 0px 1rem; box-sizing: border-box; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">Termos de uso</h1>\r\n</div>\r\n</div>\r\n<div class=\"StaticPagesContent\" style=\"padding: 0px; margin: 0px; box-sizing: border-box; font-family: Montserrat, sans-serif; font-size: 16px;\">\r\n<div class=\"sc-bxivhb iwJxYV\" style=\"padding: 0px; margin: 0px -8px; box-sizing: border-box; display: flex; flex-flow: row wrap; align-items: flex-start;\">\r\n<div class=\"sc-ifAKCX dRLhAV\" style=\"padding: 0px 8px; margin: 0px; box-sizing: border-box; width: 1063.52px; max-width: 100%; align-self: auto;\">\r\n<div class=\"ButtonStaticPages sc-bxivhb cvglGI\" style=\"box-sizing: border-box; color: #333333; background-color: #ffffff; padding: 0px; margin: 0px -8px; display: flex; flex-flow: row wrap; -webkit-box-align: center; align-items: center; border-top: none; border-bottom: none;\">\r\n<div class=\"sc-ifAKCX LAUSS\" style=\"box-sizing: border-box; padding: 0px 8px; margin: 0px; width: 797.641px; max-width: 100%; align-self: auto;\">\r\n<h4 style=\"box-sizing: border-box; font-family: inherit; font-weight: 500; line-height: 1.1; color: inherit; margin-top: 10px; margin-bottom: 10px; font-size: 13pt;\">1. Acesso</h4>\r\n</div>\r\n</div>\r\n<div class=\"sc-bxivhb iwJxYV\" style=\"box-sizing: border-box; color: #333333; background-color: #ffffff; padding: 0px; margin: 0px -8px; display: flex; flex-flow: row wrap; align-items: flex-start;\">\r\n<div class=\"sc-ifAKCX dRLhAV\" style=\"box-sizing: border-box; padding: 0px 8px; margin: 0px; width: 1063.52px; max-width: 100%; align-self: auto;\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">Este site possui acesso restrito a pessoas maiores de 18(dezoito) anos, o que ser&aacute; verificado de acordo com as informa&ccedil;&otilde;es oferecidas no momento do cadastro, as quais os usu&aacute;rios declaram ser verdadeiras.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">Pol&iacute;tica de entrega: Os produtos adquiridos somente ser&atilde;o entregues a pessoa maior de 18 (dezoito) anos, portando documento de identifica&ccedil;&atilde;o, que dever&aacute; receber a mercadoria e assinar o protocolo de entrega.</p>\r\n</div>\r\n</div>\r\n<p style=\"padding: 0px; margin: 0px 0px 1rem; box-sizing: border-box; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"StaticPagesContent\" style=\"padding: 0px; margin: 0px; box-sizing: border-box; font-family: Montserrat, sans-serif; font-size: 16px;\">\r\n<div class=\"sc-bxivhb iwJxYV\" style=\"padding: 0px; margin: 0px -8px; box-sizing: border-box; display: flex; flex-flow: row wrap; align-items: flex-start;\">\r\n<div class=\"sc-ifAKCX dRLhAV\" style=\"padding: 0px 8px; margin: 0px; box-sizing: border-box; width: 1063.52px; max-width: 100%; align-self: auto;\">\r\n<p style=\"padding: 0px; margin: 0px 0px 1rem; box-sizing: border-box; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"StaticPagesContent\" style=\"padding: 0px; margin: 0px; box-sizing: border-box; font-family: Montserrat, sans-serif; font-size: 16px;\">\r\n<div class=\"ButtonStaticPages sc-bxivhb cvglGI\" style=\"padding: 0px; margin: 0px -8px; box-sizing: border-box; display: flex; flex-flow: row wrap; -webkit-box-align: center; align-items: center; border-top: none; border-bottom: none;\">\r\n<div class=\"sc-ifAKCX LAUSS\" style=\"padding: 0px 8px; margin: 0px; box-sizing: border-box; width: 797.641px; max-width: 100%; align-self: auto;\">&nbsp;</div>\r\n</div>\r\n<div class=\"sc-bxivhb iwJxYV\" style=\"padding: 0px; margin: 0px -8px; box-sizing: border-box; display: flex; flex-flow: row wrap; align-items: flex-start;\">\r\n<div class=\"sc-ifAKCX dRLhAV\" style=\"padding: 0px 8px; margin: 0px; box-sizing: border-box; width: 1063.52px; max-width: 100%; align-self: auto;\">\r\n<p style=\"padding: 0px; margin: 0px 0px 1rem; box-sizing: border-box; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>'),(5,'PolÃ­tica de DevoluvoluÃ§Ã£o','<div class=\"ButtonStaticPages sc-bxivhb cvglGI\" style=\"font-family: Montserrat, sans-serif; font-size: 16px; padding: 0px; margin: 0px -8px; box-sizing: border-box; display: flex; flex-flow: row wrap; -webkit-box-align: center; align-items: center; border-top: none; border-bottom: none;\">\r\n<div class=\"sc-ifAKCX LAUSS\" style=\"padding: 0px 8px; margin: 0px; box-sizing: border-box; width: 797.641px; max-width: 100%; align-self: auto;\">\r\n<h5 id=\"troca-ou-devolucao\" style=\"box-sizing: border-box; font-family: inherit; font-weight: 400; line-height: 1.5; color: inherit; margin: 0.5rem 0px; font-size: 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased;\"><strong><span style=\"font-size: 14pt;\">1. Troca ou devolu&ccedil;&atilde;o</span></strong></h5>\r\n<p>&nbsp;</p>\r\n<div class=\"sc-bxivhb iwJxYV\" style=\"box-sizing: border-box; color: #333333; background-color: #ffffff; padding: 0px; margin: 0px -8px; display: flex; flex-flow: row wrap; align-items: flex-start;\">\r\n<div class=\"sc-ifAKCX dRLhAV\" style=\"box-sizing: border-box; padding: 0px 8px; margin: 0px; width: 1063.52px; max-width: 100%; align-self: auto;\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">Antes de qualquer procedimento, a troca ou a devolu&ccedil;&atilde;o dever&aacute; ser solicitada ao nosso Servi&ccedil;o de Atendimento ao Cliente.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">&Eacute; importante que voc&ecirc; guarde o produto com todos os acess&oacute;rios, sem viola&ccedil;&atilde;o dos lacres e na embalagem original. Recomendamos que, ao receber a compra, confira os itens do pedido. Em caso de desacordo, recuse o pacote antes de assinar o recibo de entrega e entre em contato com nosso Servi&ccedil;o de Atendimento ao Cliente.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">O produto ser&aacute; analisado por nosso Centro de Distribui&ccedil;&atilde;o e, caso esteja em perfeito estado, voc&ecirc; poder&aacute; escolher entre um cr&eacute;dito integral do valor pago ou ser reembolsado na forma original da compra. Retornaremos em at&eacute; 1 dia &uacute;til com as instru&ccedil;&otilde;es da coleta do produto.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">&nbsp;</p>\r\n</div>\r\n</div>\r\n<h6 style=\"box-sizing: border-box; font-family: inherit; font-weight: 400; line-height: 1.5; color: inherit; margin: 0.5rem 0px; font-size: 0.75rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; text-transform: uppercase;\"><span style=\"font-size: 12pt;\">1.2 TROCA SIMPLES</span></h6>\r\n<div class=\"sc-bxivhb iwJxYV\" style=\"box-sizing: border-box; color: #333333; background-color: #ffffff; padding: 0px; margin: 0px -8px; display: flex; flex-flow: row wrap; align-items: flex-start;\">\r\n<div class=\"sc-ifAKCX dRLhAV\" style=\"box-sizing: border-box; padding: 0px 8px; margin: 0px; width: 1063.52px; max-width: 100%; align-self: auto;\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">Em caso de troca simples, entre em contato com nosso Servi&ccedil;o de Atendimento ao Cliente.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">O produto ser&aacute; analisado por nosso Centro de Distribui&ccedil;&atilde;o e, caso esteja em perfeito estado n&atilde;o pode ter sido aberto ou com lacre violado , voc&ecirc; poder&aacute; escolher entre um cr&eacute;dito integral do valor pago ou outro item de igual valor dispon&iacute;vel no site.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">Retornaremos em at&eacute; 1 dia &uacute;til com as instru&ccedil;&otilde;es da coleta do produto.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">&nbsp;</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\"><span style=\"font-size: 12pt;\">1.3 PRODUTO EM DESACORDO</span></p>\r\n</div>\r\n</div>\r\n<div class=\"sc-bxivhb iwJxYV\" style=\"box-sizing: border-box; color: #333333; background-color: #ffffff; padding: 0px; margin: 0px -8px; display: flex; flex-flow: row wrap; align-items: flex-start;\">\r\n<div class=\"sc-ifAKCX dRLhAV\" style=\"box-sizing: border-box; padding: 0px 8px; margin: 0px; width: 1063.52px; max-width: 100%; align-self: auto;\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">Em caso de troca simples, entre em contato com nosso Servi&ccedil;o de Atendimento ao Cliente.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; line-height: 1.5; color: #666666;\">O produto ser&aacute; analisado por nosso Centro de Distribui&ccedil;&atilde;o e avaliado pelo setor de qualidade, pois o mesmo n&atilde;o pode ter sido aberto ou com lacre violado . Ap&oacute;s isso, voc&ecirc; poder&aacute; escolher entre um cr&eacute;dito integral do valor pago, reembolso na forma original da compra ou outro item de igual valor dispon&iacute;vel no site.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>');
